INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (1, N'Vironal', N'A Vironal bioinformációs, széles spektrumú, regeneráló készítmény, amelyet a', , 7500, 30, N'ml', N'A Vironal bioinformációs, széles spektrumú, regeneráló készítmény, amelyet a fitoterápia, az aromaterápia, a kristályterápia és a biorezonancia legújabb ismeretei alapján fejlesztettek ki. Ezt a magas koncentrációjú terméket (30 ml koncentrátum egyenértéku 400 ml klasszikus kivonattal) különleges technológiával állítják elo. Nem tartalmaz alkoholt, cukrot  ezért cukorbetegek is élhetnek vele , és nincs benne semmilyen mesterséges adalékanyag vagy színezék.

A Pentagram® regeneráció elvének és a hagyományos kínai orvoslásnak (HKO) megfeleloen a VIRONAL az 5 elem közül a Fém elemhez kapcsolódik, így elosegíti a Fémhez tartozó jin-jang szervpár, vagyis a tüdo, illetve a vastagbél energetikai harmóniájának helyreállítását. A VIRONAL alkalmazása egyúttal támogatja  az 5 elem sorrendjében a Fém után következo Vízhez tartozó  vese és húgyhólyag energetikai egyensúlyát.

A VIRONAL foként a tüdo, a vastagbél, a lép és a hármas melegíto energetikai pályáját, valamint a vékonybél összekötojét harmonizálja. A készítményben található gyógynövények, kristályenergiák és homeopátiás információk jótékony hatása  külön-külön és egymást erosítve is  elsosorban a légzorendszer és a kiválasztó szervek regenerálására irányul. 

ÖSSZETÉTELE:
Vérfu (oszi vérfu)  Hasmenés, gyomor- és bélvérzés, eros havi vérzés ellen fo- gyasztják (RápótiRomváry). Lázcsillapítóként, tüdo- és más légúti betegségek esetén ugyancsak használják. Baktériumölo hatású. 

Hársfavirág  Meghulés ellen, izzasztásra, köhögéscsillapításra, idegerosítésre, vértisztításra jó, enyhén serkenti a szívmuködést (RápótiRomváry). Lázas megbete- gedések esetén, vizelethajtóként, görcsoldóként és epehajtószerként szintén hasznos. 

Északi kakukkfu  Képes elpusztítani a Staphylococcus, a Streptococcus és a szalmonella baktériumokat, fertotleníto hatású. Timol tartalmú illóolajának 25-75-ször erosebb az antibakteriális hatása, mint a fenolnak. Speciálisan tágítja a hörgoket (dr. Nagy Géza). Csillapítja a köhögést, kiválóan alkalmazható tüdo- és hörgo- betegségekben, valamint övsömör esetén.

Igazi édesgyökér  Szaponinokat tartalmaz. Nyákoldó, elosegíti a suru hörghurut felszakadozását (dr. Nagy Géza). Gyulladásgátló, vérnyomásemelo. Gyomorfekély, köszvény és reuma esetén is hatásos. 

Benedekfu  Baktérium- és vírusölo, jó szolgálatot tesz emésztési zavarokban, tisztítja, fertotleníti a szervezetet, biostimulátor, megnyugtatja az idegeket (dr. Nagy Géza). Étvágyjavító, emésztést serkento, epehajtó (RápótiRomváry). Kalcium-, magnézium- és káliumsókat is tartalmaz.
Orvosi tisztesfu (bakfu, betonikafu)  Asztmás és hurutos bántalmak ellen hasznos. A népi gyógyászatban epilepszia ellen is alkalmazzák (RápótiRom- váry). Kituno segítotárs a vérzéssel járó emésztorendszeri megbetegedéseknél. Baktériumfertozések, gyulladások esetén, valamint a központi idegrendszer egyes megbetegedéseiben ugyancsak hatásos. 

Kerti torma  Antibiotikus hatóanyaga, a szinigrin glikozida a gyulladás, fertozés helyén fejti ki baktériumölo hatását (dr. Oláh Andor). Emellett gombaölo, normali- zálja a belek mikroflóráját, és kiválóan tisztítja a hörgoket.

Örvénygyökér (örménygyökér)  Asztma, magas vérnyomás, vesebántalmak, étvágytalanság, epebántalmak és bélférgek ellen, valamint a húgyutak fertotlenítésére használják (RápótiRomváry). Nyálkaoldó (régen elsosorban krónikus bronchitisben használták), gyomor-, bél- és hólyaghurutban, cukorbetegségben, vérszegénységben, gombák ellen is hasznos (Varró Aladár Béla). 

Vízi torma  Jódot és többféle vitamint tartalmaz. Gyorsítja az anyagcserét. Vese- és hólyagbántalmaknál, cukorbetegségnél, gyulladásoknál, illetve vitaminhiány esetén is alkalmazható (EisenreichHandelZimmer). A máj, az epehólyag, a lép megbetegedéseire, illetoleg vírusfertozésekre ugyancsak hasznos.', 2, 1)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (3, N'Regalen', N'A Regalen bioinformációs, széles spektrumú, regeneráló készítmény, amelyet...', , 7500, 30, N'ml', N'A Pentagram® regeneráció elvének és a hagyományos kínai orvoslásnak (HKO) megfelelõen a regalen az 5 elem közül a Fa elemhez kapcsolódik, így elõsegíti a Fához tartozó jin-jang szervpár, vagyis a máj, illetve az epehólyag energetikai harmóniájának helyreállítását. A regalen alkalmazása egyúttal támogatja  az 5 elem sorrendjében a Fa után következõ Tûzhöz tartozó  szervpárok, a szív és a vékonybél, illetve a szívburok és a hármas melegítõ energetikai egyensúlyát.
A Regalen elsõsorban a máj, az epehólyag és a hármas melegítõ energetikai pályáját harmonizálja, emellett kiegyensúlyozza a húgyhólyag-meridián összekötõjét és mellékágát, a vastagbél-meridián ín-izom pályáját, a vékonybél-energiavezeték oldalágát, a gyomormeridián összekötõjét, valamint hat a kötõszövetekre. Így elõsegíti azoknak a problémáknak a megoldását is, amelyek az említett meridiánokkal kapcsolatban álló szervek nem megfelelõ mûködésébõl erednek. (Például a máj- és az epehólyag-meridián elégtelen mûködése összefügghet emésztési nehézségekkel, gyomorsavtúltengéssel, az epehólyag mûködési zavaraival, epepangással, epekõvel, allergiával, asztmával, fejfájással, alvászavarokkal, idegességgel, ingerlékenységgel, a vérnyomás túl nagy mértékû ingadozásával, gyengébb szívmûködéssel, a látás romlásával, ízületi fájdalmakkal, ekcémával, pikkelysömörrel.
A készítményben található gyógynövények, kristályenergiák és homeopátiás információk jótékony hatása  külön-külön és egymást erõsítve is  elsõsorban a máj, az epehólyag, a belek és az immunrendszer regenerálására, valamint a vérnyomás szabályozására irányul.
A máj a szervezet méregtelenítésének legfontosabb szerve, szervpárja a HKO szerint az epehólyag. A májmûködés zavara rövid idõn belül nehézségeket okozhat az epehólyag mûködésében, és viszont.
A máj szûri ki a mérgeket a vérbõl, ellenõrzés alatt tartja a vércukorszintet, átalakítja a szénhidrátokat, fehérjéket és zsírokat, enzimeket és epét termel, mely szükséges a zsírok feldolgozásához. Ebben játszanak nagy szerepet a keserû anyagok, melyeket táplálkozásunk során sokféle ételben cukorral helyettesítettünk. Maga az epeváladék is keserû, és egyértelmû, hogy éppen a szervezetbe jutó keserû anyagok segítik a máj mûködésének javítását.
Már a régi idõkben is tudták, milyen fontosak a keserû anyagok, ezért azok nem hiányozhattak a hosszú életet ígérõ egyetlen elixírbõl sem. Az évszázadok során bevált keserû anyagok méregtelenítõ, tisztító és regeneráló szerepet töltenek be a testben.
A salak- és méreganyagok eltávolítása a szervezetbõl, vagyis a méregtelenítés csak akkor lehetséges, ha rendben vannak a beleink. A túlzásba vitt evéssel lehetõséget adunk a különbözõ kórokozóknak és a penészgombáknak a belekben való elszaporodásra. Ilyenkor a szervezet nem képes a táplálék tökéletes megemésztésére, így az a belekben rothadni kezd. Emellett romlik a táplálkozással vagy étrend-kiegészítõkkel a szervezetbe bevitt vitaminok, ásványi anyagok és nyomelemek felszívódásának hatásfoka is. Ha a bélnyálkahártya tökéletlenül mûködik, visszajutnak a testbe a máj által kiválasztott, illetve az elégtelen emésztés, a rothadás következtében keletkezõ méreganyagok. Különféle lerakódások, kisebb-nagyobb raktárak alakulnak ki belõlük  elsõsorban a zsírszövetekben, az ízületekben és az ugyancsak hibásan teljesítõ nyirokrendszerben.
A Regalen különleges illóolajkomplexet is tartalmaz, mely fékezi a bomlási folyamatokat és a penészgombák ellen is hat.
A legkülönfélébb allergiák és ekcémák, sokféle kiütés, más bõrpanaszok és az úgynevezett civilizációs betegségek a máj, az epehólyag, a vastagbél és a vese elégtelen mûködésére vezethetõk vissza. A Regalen számos olyan, biológiailag aktív anyagot tartalmaz, melyek támogatják a sejtregenerációt. Étkezés utáni alkalmazásával elõsegítjük a jobb emésztést és a szervezet méregtelenítését  márpedig a szervezet méregtelenítése egyszersmind fiatalodást jelent.', 4, 1)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (4, N'Renol', N'A Renol elsosorban a vese, a húgyhólyag, a lép és a hármas melegíto ín-izomzat...', , 7500, 30, N'ml', N'A Renol elsõsorban a vese, a húgyhólyag, a lép és a hármas melegítõ ín-izomzat energetikai pályáját, valamint a szívburok oldalágát harmonizálja. Így elõsegíti azoknak a problémáknak a megoldását is, amelyek az említett meridiánokkal kapcsolatban álló szervek nem megfelelõ mûködésébõl erednek. (Például a vese- és a húgyhólyag-meridián elégtelen mûködése összefügg a torokgyulladással, híg orrváladékkal, orrvérzéssel, könnyezéssel, magas lázzal, nyugtalansággal, szívfájdalommal, hideg lábakkal, gerinc- és ízületi fájdalommal.) A vesét és a mellékvesét a HKO egységben szemléli és gyógyítja.
A készítményben található gyógynövények, kristályenergiák és homeopátiás információk jótékony hatása  külön-külön és egymást erõsítve is  elsõsorban a vese, a kismedencei és a mozgásszervek, a nyirokrendszer regenerálására, valamint a vérnyomás szabályozására irányul.
A vesék fontos szerepet játszanak szervezetünk méregtelenítésében. Elsõdleges feladatuk, hogy az anyagcsere-végtermékeket, azaz a keletkezõ hulladékanyagokat, valamint a felesleges mennyiségben jelen lévõ nátriumot és vizet kiszûrjék a vérbõl, majd eltávolítsák a szervezetbõl. A vesék a csontvelõben végbemenõ vörösvértest-képzésben és a vérnyomás szabályozásában is részt vesznek (az utóbbiban a mellékvese-hormonokkal együtt).
A vesék és a húgyhólyag feladataihoz tartozik az ásványi anyagokkal való gazdálkodás. A vesemûködést kis mennyiségû sós élelmiszer fogyasztásával stimulálhatjuk, ezzel szemben nagyobb mennyiségû sós táplálék fogyasztásával ellenkezõ hatást váltunk ki.
A nyirokrendszer hatékonysága ugyancsak nagyban függ a vesemûködéstõl, és közvetve a vese felel a vér savbázis egyensúlyának megtartásáért. A vér pH-értéke normál esetben enyhén lúgos, 7,35 és 7,45 között van. Ha ez bármelyik irányban megváltozik, egészségünk komoly veszélybe kerül. Az egyensúlyi állapotot étkezésünk is befolyásolja. Az állati eredetû élelmiszerek megterhelik a vesemûködést, ami befolyásolja a vér pH-értékét. Ezért minél több növényi eredetû táplálékot kell fogyasztani. Aki támogatni szeretné a vesemûködését, az ne fogyasszon túl sós, édes, erõs vagy savanyú, illetve adalékanyagokat (tartósítószer, színezék stb.) tartalmazó ételeket, mert mindezektõl vesénk csak nagy erõfeszítések árán képes megszabadulni. 
A vese nagyon érzékeny szerv. Veleszületett energiát (csit) tárol, amelyre életünk végéig szükségünk van. Ezért jó, ha erõsítjük a vesemûködést, és takarékoskodunk a veleszületett energiával. A 20. életév után a vesemûködés többnyire fokozatosan gyengül, ezért gondoskodni szükséges rendszeres regenerációjáról.
A hagyományos kínai orvoslás (HKO) alapelveinek megfelelõen a gyengébb vesemûködés lelki szinten is érezteti hatását, félelmekhez vezet. Különbözõ fóbiák alakulhatnak ki: félhetünk a magasságtól, a zárt helyektõl stb. Súlyosabb esetben pánikjelenségek, depresszió is felléphet. Természetgyógyászok tapasztalatai szerint az ilyen problémákkal küszködõ embereknek szinte minden esetben szükségük van a vesemûködés erõsítésére, és ha ez megtörténik, mérséklõdnek vagy meg is szûnnek a panaszaik.

Összetétele:

Tövises iglice (iglic)  Vese- és hólyagbajok, valamint reumás bántalmak ellen hatásos, vizelethajtó (RápótiRomváry). Fokozza a húgysav kiürülését (dr. Nagy Géza). Anyagcserezavarokban, ödémában, húgykõ, vesehomok és köszvény esetén is jó.

Seprõvirág (csarab)  Vese- és hólyagbetegségekben vizelethajtó és vizeletfertõtlenítõ, bélhurut ellen összehúzó, továbbá erõsítõ, nyugtató, vértisztító, izzasztó és lázcsillapító hatású (RápótiRomváry). Vesekõ és -homok, húgyhólyag-gyulladás, prosztatanagyobbodás, reuma, ízületi fájdalom és ödéma esetén ugyancsak hasznos.

Tárkonyüröm  Vesetisztító, epehajtó és étvágyjavító (RápótiRomváry). Jódot tartalmaz, javítja az anyagcserét. Jó még érzékeny bélre és erõsítõ szerként.', 3, 1)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (5, N'Gynex', N'A Gynex  alkotórészei révén  elsosorban a befogadó, a hármas melegíto, a tüdo...', , 7500, 30, N'ml', N'A Gynex bioinformációs, széles spektrumú, regeneráló készítmény, amelyet a fitoterápia, az aromaterápia, a kristályterápia és a biorezonancia legújabb ismeretei alapján fejlesztettek ki. Ezt a magas koncentrációjú terméket (30 ml koncentrátum egyenértékû 400 ml klasszikus kivonattal) különleges technológiával állítják elõ. Nem tartalmaz alkoholt, cukrot  ezért cukorbetegek is élhetnek vele , és nincs benne semmilyen mesterséges adalékanyag vagy színezék. Kizárólag a legtisztább forrásokból származó gyógynövényekbõl speciális úton nyert kivonatot tartalmaz.
 A Pentagram® regeneráció elvének megfelelõen a Gynex az 5 elem közül a Föld elemhez kapcsolódik, így elõsegíti a Földhöz tartozó jin-jang szervpár, vagyis a lép-hasnyálmirigy, illetve a gyomor energetikai harmóniájának helyreállítását. A Gynex alkalmazása egyúttal támogatja  az 5 elem sorrendjében a Föld után következõ Fémhez tartozó  tüdõ és vastagbél energetikai egyensúlyát.
 A Gynex  alkotórészei révén  elsõsorban a befogadó, a hármas melegítõ, a tüdõ oldalága, a gyomor és a vastagbél (beleértve annak ín-izom oldalágát) energiavezetékek mûködését harmonizálja. Így elõsegíti azoknak a problémáknak a megoldását is, amelyek az említett meridiánokkal kapcsolatban álló szervek nem megfelelõ mûködésébõl erednek. (Például a befogadó meridián elégtelen mûködése összefügg az alhasi, nõgyógyászati megbetegedésekkel, a hármas melegítõé a szervezet hõháztartásával, fül- és hallásproblémákkal, migrénnel.)
 A készítményben található gyógynövények, kristályenergiák és homeopátiás információk  jótékony hatása  külön-külön és egymást erõsítve is  elsõsorban a hormonrendszer regenerálására irányul.
Hormonrendszerünk  az idegrendszerrel együtt  rendkívül fontos szerepet tölt be az egyes szervek és szervrendszerek irányításában. Egyik fontos eleme a pajzsmirigy, amely fõleg az anyagcserét szabályozza, emellett befolyásolja az ivarszervek, a nemi mirigyek aktivitását is. Tökéletes mûködéséhez elengedhetetlen a megfelelõ mennyiségû és a szervezet számára jól hasznosítható, elsõsorban szerves kötésben lévõ jód jelenléte.
 Napjainkban szinte népbetegségnek számít a pajzsmirigy csökkent vagy  más néven  alulmûködése (hypothyreosis). Az ugyancsak sokakat érintõ elhízás legtöbbször éppen a pajzsmirigy elégtelen tevékenységével függ össze. A Gynex-ben nyomelemként olyan aktív növényi anyagok vannak (pl. a jódtartalmú hólyagmoszat, valamint fitoösztrogének), amelyek jótékonyan befolyásolják az alulmûködõ pajzsmirigyet, hozzájárulnak harmonikus mûködésének helyreállításához.
Már kis mennyiségû jód is sokat jelent a szervezetnek, mert felgyorsítja az anyagcserét, szabályozza a sejtek oxigénfelhasználásának sebességét, segít elégetni a felesleges zsírt. A jód javítja a haj, a köröm, a hámréteg és a fogak állapotát.
 A Gynex fitoösztrogéneket, vagyis az ösztrogénhez hasonló módon, hormonszerûen ható növényi alkotóelemeket tartalmaz. Ezek elõnyösen befolyásolják a nõi szervek tevékenységét, javítják a méhnyálkahártya állapotát, enyhítik a klimaxszal együtt járó panaszokat. Hozzájárulnak a mellciszták és -daganatok kialakulásának megelõzéséhez, miközben alkalmazásuk nem jár együtt a változókorban (menopauza) korábban az orvosok által rutinszerûen javasolt szintetikus hormonpótlás  napjainkra már közismert  hátrányaival. A fitoösztrogének emellett gyulladásgátló hatásúak, védik a szervezetet a szív- és érrendszeri megbetegedésektõl és a csontritkulástól.
A fitoösztrogének alkalmazásával fokozatosan, szelíden, a szervezet finom áthangolásával, mindenféle káros mellékhatás nélkül érhetünk el maradandó eredményeket.
 A Gynex-ben nagy mennyiségben lévõ fitoösztrogének nemcsak a nõk, hanem a férfiak számára is csodálatos fiatalító szerként mûködhetnek. A fitoösztrogének ugyanis férfiaknál növelik a tesztoszteron férfi nemi hormon receptorainak számát, vagyis javítják a tesztoszteron hasznosulását a szervezetben. ', 5, 1)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (6, N'Korolen', N'A Korolen elsosorban a kormányzó meridián, valamint a szív, a vékonybél, a...', , 7500, 30, N'ml', N'A Korolen elsõsorban a kormányzó meridián, valamint a szív, a vékonybél, a szívburok, a hármas melegítõ energiavezeték mûködését, a lép összekötõjét és mellékágát, a vese és a máj energetikai pályáit harmonizálja. Így elõsegíti azoknak a problémáknak a megoldását is, amelyek az említett meridiánokkal kapcsolatban álló szervek nem megfelelõ mûködésébõl erednek. (Például a kormányzó, a szív és szívburok meridián elégtelen mûködése összefügghet érbetegségekkel, agyvérzéssel, infarktussal, érelmeszesedéssel, érszûkülettel, visszerességgel, magas koleszterinszinttel. Lehetséges ilyen jellegû kapcsolat hormonrendszeri, idegrendszeri és immunrendszeri zavarok vagy betegségek, gyermekek tanulási problémái, hiperaktivitás, dadogás esetén is.)
A készítményben található gyógynövények, kristályenergiák és homeopátiás információk jótékony hatása  külön-külön és egymást erõsítve is  elsõsorban a szív, a vékonybél, az agyi keringés, az érrendszer regenerálására, valamint az idegrendszer, a hormonrendszer, az immunrendszer szabályozására és lelki problémák megoldására irányul.
A szív fontossága nem szorul bizonyításra, szervpárja a hagyományos kínai orvoslás szerint a vékonybél. A HKO (nem anatómiai értelemben vett) külön szervnek tekinti és kezeli még a szívburkot és a hármas melegítõt. A szívmûködés zavara rövid idõn belül nehézségeket okozhat a vékonybél mûködésében és viszont.
A kormányzó energiavezeték kiemelkedõ fontosságú, hiszen gyakorlatilag az egész szervezet mûködését befolyásolja. A Korolen az egyik legerõsebb készítmény, amely az egész Pentagram® rendszerben dominál és a regeneráció királyaként a legmagasabb helyen áll. Ahol már minden más csõdöt mond, a Korolen még mindig bevethetõ. Ezért alkalmazzák a nagyon nehezen befolyásolható testi-lelki állapotokban. Hatást gyakorol a legmagasabban elhelyezkedõ szervünkre, az agyra, amely életmûködésünket irányítja. Befolyásolja továbbá az ereket és a vért  az életadó folyadékot, amelyik életre kelti szerveinket.
A szív, az agy, az idegrendszer és a hormonrendszer tökéletes mûködéséhez szükség van a megfelelõ keringésre, hiszen a vér szállítja el hozzájuk az oxigént és tápanyagokat. Az agy hibátlan mûködése elengedhetetlen ahhoz, hogy minden más szervünk helyesen tegye a dolgát. Ha ez nem így történik, az befolyásolja a szervezetünkben végbemenõ energiatermelõ folyamatokat. Energiaszintünk tartós csökkenése pedig krónikus fáradtság szindrómához (CFS) és a kórokozókkal szembeni védekezõképességünk, vagyis immunitásunk mérséklõdéséhez vezethet.
Az immunrendszer és a hormonrendszer hibátlan tevékenysége  más szervek mûködésével együtt  elõnyösen befolyásolja az ember élettartamát és életminõségét. Az öregedés elleni hatás azonban csak akkor érvényesül, ha elegendõ energia áll rendelkezésre. A megfelelõ energia-háztartás az egész szervezet helyes mûködésének alapja, és csak akkor érezhetjük jól magunkat, ha elegendõ van belõle.
A Korolen összetevõi  gyógynövények, illóolajok, ásványi anyagokból származó és bioinformációk  a legfontosabb meridiánokban megújítják az energia áramlását, így lehetõvé teszik, hogy meginduljanak, illetve felerõsödjenek a regeneráció folyamatai. Segítségével természetes, szelíd módon fokozhatjuk életerõnket, meghosszabbíthatjuk életünket.

Összetétele:

Páfrányfenyõ (ginkgo)  Õsi kínai fafaj, szabadgyök-fogó flavonoidokat és az érfali membránokat védõ terpéneket (ginkgolidokat) tartalmaz, Jótékony hatású agyi, illetve perifériás érbetegségek, valamint gyengült hallás, szédülés és fülzúgás esetén (prof. dr. Petri Gizella). Hasznos még memóriazavarok, fejfájás és szenilitás esetén, lassítja az öregedést.

Pau d'' Arco (lapacho, taheebo)  Dél-Amerika indiánjai évszázadok óta ismerik, és sokféle betegség kezelésére használják a fa kérgét. Hatóanyagai többek között alkaloidák, flavonoidok és szaponin, sok ásványi anyag és nyomelem is található benne.', 3, 1)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (13, N'Droserin', N'A Droserin széles körben alkalmazható, regeneráló hatású, bioinformációs krém...', , 3900, 50, N'ml', N'A Droserin széles körben alkalmazható, regeneráló hatású, bioinformációs krém, magas gyógynövényés a Podhájska hoforrásból származó termálvíz-tartalommal. Mindenekelott a tüdo, a vastagbél, a vékonybél, a szív, a máj és a gyomor energetikai pályáit befolyásolja és harmonizálja. Jótékony hatást fejt ki azokra a megbetegedésekre, amelyek az említett meridiánok elégtelen muködésébol erednek.A tüdomeridián muködési zavarának tipikus jele az erosebb köhögés, amelyet légszomj, orrdugulás, illetve kulcscsonti fájdalom kísérhet. A köhögést azonban a vese energetikai pályájának gyengülése is eloidézheti. Ez szívpanaszokhoz, légzési zavarokhoz, félénkséghez vezet, és félelemérzetet kelt az egyénben.

A hagyományos kínai orvoslás (hko) szerint a tüdo szoros kapcsolatban áll a test felhámrétegével. Ha a tüdonek megfelelo mennyiségu energiája van, a bor feszes és rugalmas lesz. Ügyeljünk tehát a helyes légzésre és a tüdo regenerálására, hiszen ezáltal borünk minosé- gét is javíthatjuk. A legtöbb embernek ajánlatos a regeneráló kúrát a Vironal és a Droserin készítményekkel kezdeni. A tüdo és a testfelszín muködése ok-okozati összefüggésben áll egyik alapveto funkciójukkal, a tápanyagelosztással. Vagyis a tüdo energiája a test felszínére szállítja a tápanyagot, a folyadékot, a vért stb. Ennek köszönhetoen a felhám megfeleloen táplált, vérrel telített, ruganyos és kelloképpen nedves marad.

A bor csak ilyen állapotban képes megóvni a testet a különbözo káros behatásoktól. A jó megjelenés egyik titka tehát a tüdo megfelelo muködése, mivel így megtörténik borünk folyamatos hidratálása, míg a különbözo hidratáló krémek csak átmeneti segítséget nyújtanak. Testünk energiakörforgásának mozgatója a negyedik energetikai centrum, vagyis a szív csakra (anahata), amely a szegycsont környékén található. Itt helyezkedik el a csecsemomirigy is, amelynek muködése nagymértékben hat az immunrendszerünkre. A Droserin jótékonyan befolyásolja a negyedik energetikai centrumunkat, és az aurafotókon ez jól megfigyelheto. A hko szerint a verejték kiválasztása a tüdo, a vizeleté pedig a vese muködésével áll kapcso- latban. A tüdo energetikájának legyengülése a testfelszín problémáihoz vezet, ami ok nélküli izzadást, gyengébb légzést okoz, valamint a bor kiszáradásában nyilvánul meg. Ellenkezo hatást is kiválthat, vagyis lehetséges a verejtéknyílások eltömodése és a verejtékezés teljes blokkolása. Amikor tüdonk harmonikusan muködik, érzékenyebbek vagyunk a különféle szagokra, illatokra, hangunk pedig csengobbé és tisztábbá válik. Hangunk tisztaságához azonban a vese helyes muködése is szükséges. Az orrüregek eldugulása szintén a tüdoenergia nem megfelelo muködésére utal.
Aki tüdogyengeséggel, illetve elégtelen energiaellátással született, azon sokkal inkább elhatalmasodhat a szomorúság és a bánat érzése. A tüdo érzékeny szerv, nem feledkezhetünk meg a regenerálásáról, hiszen testünk valamennyi energiáját irányítja és szabályozza. A Droserin egyedülálló módon regenerálja a bort, tökéletes bortisztító. Különleges összetétele áldásos hatású a tüdore. Kivételes tulajdonságai a készítményben levo természetes anyagok- nak köszönhetok, amelyek alapja a Podhájska hoforrás termálvize. A Droserin hévíztartalma 50%. Ez a harmadkori, energiadús tengervíz magas nyomáson, 80 °C fokos homérséklettel tör a felszínre, számos ásványi anyagot és nyomelemet tartalmaz. Regenerációs, fertotleníto, tisztító, gyulladásgátló, vérboséget kelto hatása tartósabb és mélyebb, mint a Holt-tenger vizéé. Kiegyensúlyozott arányban tartalmaz sót, bórsavat, kovasavat, magnéziu- mot, cinket, jódot, lítiumot, kalciumot, krómot, káliumot, brómot, fluort, stronciumot, rubídiumot, titánt, vasat, rezet és további elemeket.', 2, 2)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (14, N'Protektin', N'A Protektin egyedülálló módon regenerálja a bort. Kivételes hatása a készítmény...', , 3900, 50, N'ml', N'A Protektin széles körben alkalmazható, regeneráló hatású, bioinformációs krém, magas gyógynövény- és a Podhájska hoforrásból származó termálvíztartalommal. Elsosorban a máj, az epehólyag, a gyomor, a lép-hasnyálmirigy energetikai pályáit befolyásolja és harmonizálja. Jótékony hatást fejt ki azon megbetegedéseknél, ame- lyek az említett meridiánok elégtelen muködésébol erednek. 

A Protektin egyedülálló módon regenerálja a bort. Kivételes hatása a készítményben levo természetes anyagoknak köszönheto, amelyek alapja a Podhájska hoforrás termálvize. A Protektin hévíztartalma 50%. Ez a harmadkori, energiadús tengervíz magas nyomáson, 80 °C fokos homérséklettel tör a felszínre, számos ásványi anyagot és nyomelemet tartalmaz. Regenerációs, fertotleníto, tisztító, gyulladásgátló, vérboséget kelto hatása tartósabb és mélyebb, mint a Holt-tenger vizéé. Kiegyensúlyozott arányban tartalmaz sót, bórsavat, kovasavat, magnéziumot, cinket, jódot, lítiumot, kalciumot, krómot, káliumot, brómot, fluort, stronciumot, rubídiumot, titánt, vasat, rezet és további elemeket. A Protektin összetevoi jótékonyan hatnak az ekcémára, különféle kiütésekre és számos más borbetegségre. A krém további elonye, hogy vízzel könnyen lemosható.

A bioinformációs krém további összetevoi között gyógynövénykivonatokat találunk. A krém jelenlegi összetétele éveken át tartó, pontos munka eredménye. A benne lévo parfüm és illóolajok révén a krém a bor regenerációjának elosegítésén kívül illatosít is.

A Protektinben borecet is van. Ez a 100%-ban természetes anyag különbözo ki- ütések esetén rövid ido alatt megszünteti a viszketést, emellett eros antibakteriális és gyulladásellenes hatású. Megelozi a gombásodást, és segít a felhám helyes pH-értékének megtartásában.

Tartalmaz még AHA savakat, amelyek kedvezoen befolyásolják a felhám regenerálódását.
Az Energy kutatólaboratóriumaiban létrehozott gyógyító, biológiailag aktív anyagok segítségével a kiütések gyorsabban eltunnek és a beteg felhám (pl. borelváltozás) hamarabb gyógyul. Elsosorban energinekrol van szó, amelyek a poliszacharidok speciális fajtái. Ezek  többek között  ellenállnak a különféle sugárzásoknak. Alkalmazásuk herpesz és más vírusok ellen felgyorsítja a bor regenerálódását.

A Protektinben humin anyagok (azaz harmadkori növényekbol és tozegbol szár- mazó kivonatok) ugyancsak megtalálhatók. Ezek az összetevok szintén ellenállók a sugárzásokkal szemben, és hatnak a herpesz vírusokra. 

A bioinformációs krémben lévo gyantákat évszázadokon át használták nehezen gyógyuló sebekre, valamint mumifikálásra. A gyantaolaj és a gyantasav kórokozó- ellenes hatású, továbbá elosegíti a borsejtek regenerációját. A sárkányfa gyantáját a Kanári-szigeteken alkalmazták. Kísérletek alátámasztották már ismert jótékony hatásait, és továbbiakat fedeztek fel, mint pl. a gyulladáscsökkento, daganatellenes, antioxidáns, immunerosíto tulajdonságokat. Az egyes kelet-indiai tulevelu fákból nyert világossárga, áttetszo dammár (vagy kopál) gyanta megakadályozza a gombásodást. 

Kóros borelváltozások és elhanyagolt bor esetén a bortisztító és -védo Protektin alkalmazását az ugyancsak regeneráló hatású Pentagram® gyógynövénykoncent- rátumokkal együtt ajánljuk. A bor minosége  feszessége, rugalmassága  a tüdo muködésétol is függ. A tüdo muködése a Vironal és a Droserin készítmények segít- ségével javítható. Használatukkal Ön sokat tesz bore egészségéért. A Renol segít eltüntetni vagy mérsékelni a borelváltozásokat, kiütéseket. Ekcéma esetén segít a Regalen, a Renol és a King Kong.', 2, 2)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (15, N'Arttin', N'Az Artrin kivételes tulajdonságai a készítményben levo természetes anyagoknak...', , 3900, 50, N'ml', N'Az Artrin széles körben alkalmazható, regeneráló hatású, bioinformációs krém,- magas gyógynövény- és a Podhájska hoforrásból származó termálvíz-tartalommal. Mindenekelott a lép-hasnyálmirigy, a gyomor, a vastagbél, a vékonybél, a máj, a vese és a húgyhólyag energetikai pályáit, valamint a befogadó és a hármas melegíto meridián muködését befolyásolja és harmonizálja. Jótékony hatást fejt ki azokra a megbetegedésekre, amelyek az említett energiapályák elégtelen muködésébol erednek.

Koncentrált tozegkivonatot és liposzómákat tartalmaz, ezeknek gyulladásgátló és daganatellenes hatásuk van. A tozegkivonat jótékony összetevoit a liposzómák (foszfolipideket tartalmazó vivoanyagok) juttatják el a bor mélyebb rétegeibe. A to- zeg eros antioxidáns, eredményesen alkalmazható mozgásszervi problémáknál, véd a káros sugárzásokkal szemben. A tozegfürdo áldásos hatásait világszerte ismerik.

Az Artrin kivételes tulajdonságai a készítményben levo természetes anyagoknak köszönhetok, amelyek alapja a Podhájska hoforrás termálvize. A bioinformációs krém hévíztartalma 50%. Ez a harmadkori, energiadús tengervíz magas nyomáson, 80 °C fokos homérséklettel tör a felszínre, számos ásványi anyagot és nyomelemet tartalmaz. Regenerációs, fertotleníto, tisztító, gyulladásgátló, vérboséget kel- to hatása tartósabb és mélyebb, mint a Holt-tenger vizéé. Kiegyensúlyozott arányban tartalmaz sót, bórsavat, kovasavat, magnéziumot, cinket, jódot, lítiumot, kalciumot, krómot, káliumot, brómot, fluort, stronciumot, rubídiumot, titánt, vasat, re- zet és további elemeket. Jótékonyan hat a mozgásszervekre, különbözo kiütésekre, nyugtatja a gyulladt bort, és számos más értékes hatása van. Míg más külsoleg alkalmazható készítmények csupán 1-3%-ban tartalmaznak növényi kivonatokat, az Energy regeneráló krémjeinél ez az érték 30-50%.

A krém só- és illóolaj-tartalma segíti az érintett területek vérellátását. Használatakor javul a keringés, ami gyorsítja a regenerációs folyamatokat. Az illóolajok is közre- muködnek a regenerációban. A kámforolaj támogatja az emésztorendszert, a vérkeringést és a szívet, nyugtató hatású, reumás betegségekben jól alkalmazható. A benzoin nyugtató és csírátlanító hatásán kívül kedvezoen befolyásolja a náthát, a légcsohurutot, az izomgyulladást és a köszvényt. Hasonlóan jó erre a célra a természetes szalicilátokat tartalmazó tujaolaj. A földimogyoró-olaj kituno ízületi gyulladásra, táplálja a bort és az izmokat.

Az Artrin kiegyensúlyozott növényi hatóanyag és illóolaj tartalma javítja a keringést, gyulladásgátló, baktérium-, vírus- és mikrobaellenes hatású. Almaecetet is tartalmaz, amely felgyorsítja a regeneráció folyamatát, gombaellenes és nyugtató hatású, való- ságos balzsam a fáradt test és az ernyedt bor számára. A bioinformációs krémben lévo AHA savak kedvezoen befolyásolják a felhám regenerálódását.

A készítmény természetes összetevoinek az ízületekre gyakorolt hatását kiegészítik a hangyasavból és a borostyánkobol származó bioinformációk. Jótékonyan befolyá- solja a bor regenerációját a lenmagolaj és az E-vitamin, valamint az édesgyökér fitohormonjai. A krém antioxidáns hatása az E-vitaminnak és a természetes növényi festékanyagoknak köszönheto.

Van még benne gyömbér, amely laboratóriumi vizsgálatok szerint elpusztít egyes hüvelyi kórokozókat. A Dél-dániai Egyetemen (Odense) mutatták ki, hogy a gyömbér hatóanyagai jótékonyan befolyásolják a gyulladásos folyamatokért felelos anya- gok termelodését, és ezáltal mérséklik az ízületi gyulladásban szenvedo betegek fájdalmát. További kutatások igazolták, hogy a gyömbér segít utazási betegségben (kinetosis) és csillapítja a migrén okozta fájdalmat is.

Az Artrin külsoleg alkalmazható az ízületekre, a gerincoszlop mentén, továbbá a bornek a vese és a húgyhólyag feletti területein.', 3, 2)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (16, N'Cytovital', N'A bioinformációs krémben humin anyagok (azaz harmadkori növényekbol és tozegbol...', , 3900, 50, N'ml', N'A Cytovital széles körben alkalmazható, regeneráló hatású, bioinformációs krém, magas gyógynövény- és a Podhájska hoforrásból származó termál- víz-tartalommal. Mindenekelott a szív, a tüdo, a lép-hasnyálmirigy, a gyomor, a húgyhólyag, a hármas melegíto energiapályáit és a befogadó meridiánt befolyásolja.

Borünk állapota, minosége elsosorban a méregteleníto szervek muködésétol függ. A Cytovital nagymértékben regenerálja a felhámot, valamint táplálja annak sejtjeit. Energiaforrásként szolgál a bornek, valódi természetes, fiatalító hatású készítmény. A hormonrendszerre is hat.

A bioinformációs krémben lévo gyantákat évszázadokon át használták nehe- zen gyógyuló sebekre, valamint mumifikálásra. A gyantaolaj és a gyantasav kórokozó-ellenes hatású, továbbá elosegíti a borsejtek regenerációját. A sár- kányfa gyantáját a Kanári-szigeteken alkalmazták. Kísérletek alátámasztották már ismert jótékony hatásait, és továbbiakat fedeztek fel, mint pl. a gyulladás- csökkento, daganatellenes, antioxidáns, immunerosíto tulajdonságokat. Az egyes kelet-indiai tulevelu fákból nyert világossárga, áttetszo dammár (vagy kopál) gyanta megakadályozza a gombásodást.A Cytovitalban borecet is van. Ez a 100%-ban természetes anyag különbözo kiütések esetén rövid ido alatt megszünteti a viszketést, emellett eros antibakte- riális és gyulladásellenes hatású. Megelozi a gombásodást, és segít a felhám helyes pH-értékének megtartásában. Tartalmaz még AHA savakat, amelyek kedvezoen befolyásolják a felhám regenerálódását.
A bioinformációs krémben humin anyagok (azaz harmadkori növényekbol és tozegbol származó kivonatok) ugyancsak megtalálhatók. Ezek az összetevok a legerosebb antioxidánsok közé tartoznak, és ellenállók a különféle sugár- zásokkal szemben, beleértve az UV sugárzást is. A krém emiatt hasznos lehet sugárkezelésben részesülo rákbetegek borének sugárzás elleni védelmére, illetve elonyös a használata a szoláriumokban. Egy kísérlet szerint a tozegki- vonat elosegítheti a daganatok összezsugorodását. A humin anyagok a herpesz és a cytomegalo vírusokra is hatnak. Az Energy krémjei közül a legnagyobb mennyiségu tozegkivonatot a Cytovital tartalmazza.

A különbözo sugárzásokkal szemben az energinek is védenek. Az Energy kutatólaboratóriumaiban létrehozott gyógyító, biológiailag aktív anyagok a poliszacharidok speciális fajtái; segítségükkel a kiütések gyorsabban eltunnek és a beteg felhám (pl. borelváltozás) hamarabb gyógyul. Az energinek al- kalmazása herpesz és más vírusok ellen felgyorsítja a bor regenerálódását. A Cytovital egyedülálló módon regenerálja a bort. Kivételes hatása a készít- ményben levo természetes anyagoknak köszönheto, amelyek alapja a Podhájska hoforrás termálvize. A bioinformációs krém hévíztartalma 50%. Ez a harmad- kori, energiadús tengervíz magas nyomáson, 80 °C fokos homérséklettel tör a felszínre, számos ásványi anyagot és nyomelemet tartalmaz. Regenerációs, fertotleníto, tisztító, gyulladásgátló, vérboséget kelto hatása tartósabb és mélyebb, mint a Holt-tenger vizéé. Kiegyensúlyozott arányban tartal- maz sót, bórsavat, kovasavat, magnéziumot, cinket, jódot, lítiumot, kalciumot, krómot, káliumot, brómot, fluort, stronciumot, rubídiumot, titánt, vasat, rezet és további elemeket.
A krémben olyan növények kivonata található, amelyek borfiatalító hatásuk- kal tunnek ki. Közéjük tartozik az egyik leghíresebb orchidea faj, a vanília. Bortisztítás után a kozmetikai szalonban vagy otthon élvezze ennek a tápláló és fiatalító krémnek a csodálatos hatását! Visszaadja a bor üdeségét és egész- séges kinézetét. A készítmény fiatal borre is alkalmazható.', 5, 2)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (17, N'Ruticelit', N'A Ruticelit egyedülálló módon regenerálja a bort. Kivételes hatása a készítményben...', , 3900, 50, N'ml', N'A Ruticelit széles körben alkalmazható, regeneráló hatású, bioinformációs krém, magas gyógynövény- és a Podhájska hoforrásból származó termálvíztartalommal. Mindenekelott a szív, a lép-hasnyálmirigy, a vékonybél, a máj és vese energia- pályáit befolyásolja.

Tartalmaz még tozegkivonatot, melynek gyulladásgátló és daganatmegelozo ha- tását vizsgálatok bizonyították. Mint neve is utal rá, a Ruticelit fo hatóanyagai a rutin és más flavonoidok. A flavonoidok eros növényi antioxidánsok, és a podhájskai termálvíz egyes összetevoi fokozzák ezt a hatást. A flavonoidok kedvezoen hatnak az allergiás és fertozo betegségek lefolyására, továbbá a magas vérnyomásra, daga- natokra, érelmeszesedésre, csökkentik a vér túlzott alvadékonyságát (a vérlemezkék összetapadásának gátlásával), és erosítik a hajszálerek szilárdságát, rugalmasságát.

A Ruticelit egyedülálló módon regenerálja a bort. Kivételes hatása a készítményben levo természetes anyagoknak köszönheto, amelyek alapja a Podhájska hoforrás termálvize. Ez a harmadkori, energiadús tengervíz magas nyomáson, 80 °C fokos homérséklettel tör a felszínre, számos ásványi anyagot és nyomelemet tartalmaz. Regenerációs, fertotleníto, tisztító, gyulladásgátló, vérboséget kelto hatása tartósabb és mélyebb, mint a Holt-tenger vizéé. Kiegyensúlyozott arányban tartalmaz sót, bórsavat, kovasavat, magnéziumot, cinket, jódot, lítiumot, kalciumot, krómot, káliumot, brómot, fluort, stronciumot, rubídiumot, titánt, vasat, rezet és további elemeket. A podhájskai forrásvíz magas lítiumtartalma jótékony hatású a depressziós betegekre.

A Ruticelit összetevoi jótékonyan hatnak érrendszeri betegségekre, bor- és ideg- gyulladásra, felfrissítik a fáradt lábat. A krém további elonye, hogy vízzel könnyen lemosható.

A krémben lévo növényi eredetu olajok, például a lenmagolaj alkalmasak az I. fokú égési sebek kezelésére. A további összetevok, mint a fluor, a szilícium és a lecitin  a természetes eredetu flavonoidokkal együtt  javítják a hajszálerek szilárdságát és rugalmasságát. Az eros gyulladásgátló növényi alkotók, valamint a bórsav, a kén és a tozegbol származó humuszsavhoz kötött cink kombinációja alkalmassá teszik a krémet az aranyérproblémák kezelésére.

A podhájskai termálvíz további értékes alkotóelemei a magnéziumsók, melyek ki- fejezetten hatásosak allergiában és többféle borbetegségben. A természetes eredetu A- és E-vitamin fokozza ezt a hatást. A termálvíz ásványianyag-tartalma természetes borradírként (peeling) szolgál. Ha a vizet felrázzuk, habzani kezd, ez igazolja eros tisztító hatását. Ezt tovább erosíti az úgynevezett AHA savakat tartalmazó almaecet, ami penész- és mikrobaellenes, gyulladásgátló, nyugtató és regeneráló tulajdonságú. Aki az arcán próbálja ki a podhájskai termálvizet, érezheti annak a bort kisimító, ránctalanító hatását.

A lenmagolaj félig száraz állapotban védofilmet képez a borfelületen. Alkalma- zására már a Bibliában találhatunk utalást. Eros regenerációs hatású, foként kor- pásodás és kiütések esetén hasznos. A ricinus-, a szezám- és a szójaolaj jótékony hatása ugyancsak határozottan érezheto.

A bioinformációs krém további alkotórészei között gyógynövénykivonatokat találunk. A krém jelenlegi összetétele éveken át tartó, pontos munka eredménye. A benne lévo parfüm és illóolajok révén a krém a bor regenerációjának elosegítésén kívül illatosít is.Az Energy csúcsminoségu infokozmetikumának elonye a sokrétu, könnyu és ha- tékony használat. Mindennapi alkalmazásának elonyei a szépségápolásban (a bor puhasága és rugalmassága, antioxidáns védelem, AHA savak, homeopátiás, gyulladásgátló és kozmetikai célú anyagok) nyilvánvalóak.', 5, 2)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (19, N'Droserin Renove', N'Megújít a száraz, elvékonyodott bort, amely már nem képes megfeleloen ellátni...', , 7900, 100, N'ml', N'Megújít a száraz, elvékonyodott bort, amely már nem képes megfeleloen ellátni védelmi feladatát. Ez a RENOVE termékcsalád legzsírosabb krémje, ezért az extra száraz boruek is alkalmazhatják. Óvja a bort a külso hatásoktól (hideg, szél és fagy), ezért téli krémként is használható minden bortípusra. Nappali és éjszakai krémként egyaránt alkalmazható.

Hatóanyagok: színtiszta növényi argánolaj, mandulaolaj, makadámolaj, jojobaolaj és feketekömény-olaj,  borostyánkosav, geránium, bigarádia (keseru narancs), niauli, levendula és mirtusz  olaja, arália, ökörfarkkóró, kinin, japán akác, útifu, kender, kurkuma, édesgyökér, kerti sarkantyúka, izlandi zuzmó, tüdofu, martilapu, orvosi ziliz, zsurló, rózsa, kakukkfu, izsóp és gyömbér kivonata.

A DROSERIN RENOVE a Fém elemhez tartozik, és a Szárazság energiájával áll kapcsolatban.

Az évszakok közül az osz tartozik a Fém elemhez, az égtájak közül pedig a nyugat. A Fém elem az ember életútján közvetlenül a termékeny Föld idoszaka után következik, és az aktív élet csúcsperiódusa fölött uralkodik. A Fém idoszaka az érés és a betakarítás, majd pedig a hervadás és a kiszáradás. Összefügg továbbá az önérvényesítés képességével, a szilárdsággal, a felelosséggel és a céltudatossággal, viszont negatív érzésként vagy magatartásformaként jelentkezo árnyoldala a harciasság, a sírás, a szomorúság, a rossz alkalmazkodóképesség és a szorszálhasogatás.

A napfényben fürdo mirtuszliget illata felébreszti és élesíti az érzékeket, biztonságérzetet, kiegyensúlyozottságot ad, és erosíti a belso béke érzését.
', 4, 3)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (20, N'Protektin Renove', N'Kombinált és zsíros borre vagy kiütésekre, borgyulladásra (dermatitiszre)...', , 7900, 100, N'ml', N'Kombinált és zsíros borre vagy kiütésekre, borgyulladásra (dermatitiszre) és aknéra hajlamos, problémás borre ajánlott. Hatékonyan gyógyítja a gyulladt vagy ekcémás területeket, miközben nem szárítja a bort, sot puhává teszi és összehúzza a pórusokat. Vitaminok és ásványi anyagok, foleg kalcium és magnézium gazdag forrása. Megakadályozza a pigmentfoltok kialakulását, illetve csökkenti kiterjedésüket, és természetes úton semlegesíti a toxinokat. Nappali és éjszakai krémként egyaránt alkalmazható.
Hatóanyagok: színtiszta növényi argánolaj, mandulaolaj, kenderolaj és mákolaj, kaolin, borostyánkosav, geránium, bigarádia (keseru narancs), niauli, levendula és cisztusz illóolaja, arália, japán akác, kecskeruta, gólyaorrfu, fekete nadályto, édesgyökér, gyújtoványfu, bojtorján, zsurló, kálmosgyökér, százszorszép, tejoltó galaj, csukóka, réti nyúlhere, virginiai varázsmogyoró, illatos ibolya, fecskefu seprovirág és füstike kivonata.

A PROTEKTIN RENOVE a Fa elemhez tartozik, és a Szél energiájával áll kapcsolatban.

A Fához a zöld szín, a savanyú íz és az égtájak közül a kelet tartozik. Az évszakok sorából a tavasz kapcsolódik hozzá, az ember életútját tekintve pedig a gondtalan gyermekkor analógiája. A Fa gyors fejlodést, látomást, tervezést, döntéseket, kíváncsiságot, illetve vele összefüggo eredetiséget és kreativitást jelent, de negatív érzésként vagy magatartásformaként jelentkezo árnyoldala elhamarkodott viselkedésben, haragban vagy a tervek befejezésének, illetve megvalósításának képtelenségében nyilvánulhat meg.

A levendulával átszott cisztusz illata olyan friss, mint a virágos réten lejtett tánc nyári zápor idején. Ez az illatkombináció támogatja a megbízhatóságot és ellenálló-képességet ad.', 2, 3)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (21, N'Artrin Renove', N'Fáradt, száraz, érzékeny és természetes színét vesztett borre ajánlott.', , 7900, 100, N'ml', N'Fáradt, száraz, érzékeny és természetes színét vesztett borre ajánlott. Megfeleloen táplálja, védi, hidratálja a bort, továbbá megakadályozza a kiszáradását. Gyógyítja az apró hegeket, és kisimítja a kezdodo ráncokat, segít eltüntetni a szem alatti sötét karikákat. Nappali és éjszakai krémként egyaránt alkalmazható.

Hatóanyagok: színtiszta növényi argánolaj, mákolaj, mandulaolaj és jojoba olaj, Croton lechleri, borostyánkosav, geránium, bigarádia (keseru narancs), vanília, jázmin és cédrus illóolaja, fehér akác, aranyvesszo, vadgesztenye, orvosi somkóró, kapor, fekete nadályto, édesgyökér, kerti sarkantyúka, gyújtoványfu, lepkeszeg, árnika, kálmosgyökér, betyárkóró, legyezofu, babér és gyömbér kivonata.

Az ARTRIN RENOVE a Víz elemhez tartozik, és a Hideg energiájával áll kapcsolatban.

A Vízhez a kék és a fekete szín, a sós íz, az északi égtáj és a téli hónapok tartoznak. Az ember életútján az utolsó szakaszt uralja. A Víz elemre a bölcsesség, az intuíció, a szerénység, a kitartás, az állandóság és a megbékélés a jellemzo. Másrészrol a Víz elem árnyoldala, esetleges negatív érzései vagy magatartásformája a félelem, a depresszió, a merevség és az állandó aggódás.

Egy nyáresti, tengerparti séta illata. Az arab jázmin és a cédrus illatának egyedi keveréke erot ad a mindennapokhoz. Támogatja az alkotókedvet és az örömre való képességét.
', 2, 3)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (23, N'Ruticelit Renove', N'Könnyu, revitalizáló összetételével minden bortípusra ajánlott. Ha nem túl zsíros...', , 7900, 100, N'ml', N'Könnyu, revitalizáló összetételével minden bortípusra ajánlott. Ha nem túl zsíros a bore, de nem érzi úgy, hogy száraz volna, nem húzódik   akkor Önnek a RUTICELIT RENOVE a legjobb választás. Elsosorban olyan arcbor kezelésére ajánljuk, amelyen kitágult hajszálerek (kuperózis) láthatók. Megerosíti és növeli az erek rugalmasságát, támogatja a mikrokeringést, csillapítja a viszketést. Puhává és selymessé varázsolja az arcbort. Nappali és éjszakai krémként egyaránt alkalmazható.

Hatóanyagok: színtiszta növényi argánolaj, mandulaolaj, makadámolaj, fekete kömény olaj, borostyánkosav, Vermesin®, geránium, bigarádia (keseru narancs), vanília, rózsa és ciprus illóolaja, ribiszke, japán akác, Ginkgo biloba, vadgesztenye, orvosi somkóró, fekete nadályto, oszi vérfu, körömvirág, hajdina, árnika, zsurló, kerti ruta, orbáncfu, réti nyúlhere és virginiai varázsmogyoró kivonata.

A RUTICELIT RENOVE a Tuz elemhez tartozik, és a Ho, illetve a Meleg energiájával áll kapcsolatban.

A Tüzet a keseru íz, a déli égtáj és az évszakok közül természetesen a nyár jellemzi. Az ember életében az örömteli gyermekkort képviseli. A Tuz idoszaka az intenzív lelki fejlodéssel, a kíváncsisággal, az intuícióval és sok nevetéssel, a külso tényezoktol független boldogság átélésének képességével áll kapcsolatban. Az árnyoldalon viszont negatív érzelemként vagy viselkedésként ott van a zavarodottság és az a helyzet, amikor az ember képtelen kifejezni magát.

A rózsa egy cseppnyi tiszta szeretetesszencia, amely fokozza az örömöt, erosíti a bizalmat és önmagunk elfogadását.', 2, 3)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (24, N'Visage Szérum', N'Természetes revitalizáló, enzimprotein komplex. Két szabadalmaztatott hatóanyagot...', , 7900, 100, N'ml', N'Természetes revitalizáló, enzimprotein komplex. Két szabadalmaztatott hatóanyagot, Vermesint® és Helixint® tartalmaz, továbbá argánolajjal, Aloe verával és természetes, illóolajos parfümmel dúsították.
Igen magas koncentrációban tartalmaz hatóanyagokat. Használható önmagában vagy alapozó bázisként bármelyik krém alá.

A szérumot hetente legalább 2x alkalmazza, lágy mozdulatokkal ütögesse be a borébe. Használja önmagában vagy a kedvenc RENOVE krémjével kombinálva.

Hatóanyagok: argánolaj, Helixin®, Vermesin®, Aloe vera, geránium, bigarádia (keseru narancs), vanília, rózsa, ciprus és ilang-ilang illóolaja.

A Vermesin® a kaliforniai esoerdok enzimfrakciója. Számtalan olyan enzimet foglal magában, amely képes bejutni a bor mélyebb rétegeibe, hogy ott beindítsa a szükséges biokémiai folyamatokat. Felgyorsítja a sebgyógyulás és a regeneráció folyamatát. Jellegzetes illata már néhány másodperc múlva érezhetové válik, és idovel változhat.

A Helixin® a kaviár összetevoihez hasonló hatóanyagok kivonata. Fehérjéket, vitaminokat és ásványi anyagokat, továbbá aminosavakat és foszfolipideket tartalmaz. Védoréteget hoz létre a borben, óvja a kollagént a degenerációtól, és ezzel párhuzamosan segíti az új kollagén képzodését. Támogatja a sejtek megújulását, és serkenti a természetes regenerációt. Mérsékli a bor természetes vízveszteségét, és hozzájárul ahhoz, hogy a bor sokáig üde és fiatalos maradjon. Nátriumot, káliumot, kalciumot, foszfort, magnéziumot, A-, B-, D-vitamint, izoleucint, lizint, treonint, triptofánt, arginint, glicint, alanint, tirozint, cisztint, aszparaginsavat, glutaminsavat, telítetlen zsírsavakat (EPA-t és DHA-t) tartalmaz.

Intenzív tápláló és regeneráló hatású. Tápanyagokkal látja el, fiatalossá varázsolja, fényesíti a bort, és visszaadja rugalmasságát. Csökkenti a ráncokat és hidratálja a bort. Jótékonyan hat a pigmentációra, egyben gyulladáscsökkento.', 3, 3)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (25, N'Cara Lotion', N'Testápoló tej bioinformációs hidratáló készítmény, eroteljes regeneráló hatással...', , 3200, 200, N'ml', N'A Caralotion testápoló tej bioinformációs hidratáló készítmény, eroteljes regeneráló hatással a test egész borfelületére. Eros antioxidációs hatással rendelkezik, könnyen adagolható, és kenheto.

A tejet finomam masszírozzuk be a borünkbe, lehetoség szerint fürdés után, így érhetjük el a bioaktív anyagok optimális hatását.

A Caralotion testápoló tej megfelelo kiegészítoje a Protektinnek  elosegíti a bor tisztító funkciójának megújulását. A hatóanyagai a nanoszférákon keresztül a bor mély rétegeibe is eljutnak, ahol lassan szabadulnak fel.

Részletesebben az összetevokrol:
Gyógynövény kivonat
Összetevoi túlnyomórészt a borre kedvezo hatású gyógynövények.

Közönséges gyújtoványfu: hangyasavat, almasavat és ecetsavat tartalmaz, gyógyítja a gennyesedo sérüléseket.

Réti nyúlszapuka: flavonoid-tartalma kedvezoen hat a rosszul hegedo sebekre, felfekvésekre, égési sérülésekre és borgyulladásokra.

Háromszínu vadárvácska: rutin, és egyéb flavonoid-tartalma miatt hatásos ekcémák, és allergiás kiütések ellen.

Japánakác: pikkelysömör és allergia gyógyításában eroteljes hatású.

Százszorszép: a flavonoidok, a szaponinok, nyálka, és a csersav eroteljes hatással bírnak a herpesz, kiütések, pikkelysömör és pattanások esetén.
 

Alaptid
Eredeti csehszlovák szabadalmaztatott vegyület, olyan polipeptid, amely képes többszörösen magához kötni a vizet és regenerálni a sejteket. A készítményben lévo kalcium, növényi anyagok, valamint ásványi sók ezeket a tulajdonságokat erosítik. 

Több mint 60 ásványi anyag és nyomelem alkotta komplexum
A Caralotion a Podhájská hoforrás harmadkori tengervízébol származó természetes ásványok, és sók széles palettáját tartalmazza, melyek melegítik, táplálják és védik a bort. A termálvíz magas energetikai potenciáljának, és különleges összetételének köszönhetoen kedvezo hatással van a bor sejtjeire. 

Azelasav
Rákellenes és hegedést elosegíto hatású. 

Növényi olajak és ceramidek komplexuma
A hidegen sajtolt olajak megtartják a természetes tápláló tulajdonságaikat és egészében rendkívül pozitív hatással vannak a bor szerkezetére. Összetevoi közé tartozik a kender-, a mák-, a len- és a szója olaj. 

Borostyánkosav
Eros sejtregeneráló hatása van. Már az osi Egyiptomban is borostyánko lapokat varrattak a fáraók a borük alá, mert hittek a fiatalító hatásában. A modern kutatások is kimutatták, hogy a borostyánkosav rendelkezik ezzel a hatással. 

Bioaktív anyagok a kaliforniai földi gilisztából, és kaviárcsigából, melyek kedvezoen hatnak a bor hormonális muködésére, táplálására, a vérellátás fokozására, és a regenerálására. ', 4, 4)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (26, N'Dermaton olaj', N'A Dermaton természetes, könnyen beszívódó olaj, elosegíti a bor tökéletes...', , 4900, 100, N'ml', N'A Dermaton természetes, könnyen beszívódó olaj, elosegíti a bor tökéletes regenerációját. 
Rizscsíra-, homoktövis-, valamint jojobaolajat, továbbá lecitint és illóolajokat tartalmaz. Az utóbbiak közül a legfontosabb a levendulaolaj, illetve a kakukkfu illóolaja. Nem tartalmaz UV elleni védofaktort, ezért napolajként nem használható.

Alkalmazási területek:
Regeneráció és táplálás / mindennapi borápolás / napozás utáni ápolás / enyhébb égési sérülések gyógyítása / káros hatásokkal szembeni védelem / a bor ido elotti öregedésének megakadályozása.

A Dermaton olaj hatásai:
A Dermaton könnyen beszívódó, természetes olaj, amely kiváló mindennapos regenerációt biztosít a száraz és a normál bornek egyaránt. Nyugtatja a bort, és enyhíti a külso környezet vagy a napsugárzás kellemetlen hatásait. Csillapítja az elso fokú égési sérülések (borpirosodás) miatt fellépo fájdalmat, és megszünteti a sebgyógyulás idején érzett borviszketést. Felgyorsítja a bor mélyebb rétegeinek regenerálódását, és védi a túlzott kiszáradástól.
Az olaj karotinoidban, A- és E-vitaminban, telítetlen zsírsavakban, valamint antioxidánsokban rendkívül gazdag. Ezek közül is a legjelentosebb a gamma-oryzanol. Ezek az anyagok támogatják a napsugárzás hatására létrejött szabad gyökök borbol történo eltávolítását, ezáltal lassítják a bor öregedési folyamatát. A homoktövisbol származó olaj serkenti a melanocitákat, azaz napozás után felgyorsítja a pigmentképzodést. A jojobaolaj egyfajta védoréteget hoz létre a bor felszínén, így ellenállóbbá teszi a bort a mechanikus terheléssel, valamint a vegyi anyagok hatásaival szemben. Ez a filmréteg az illóolajokkal együtt segít távol tartani a kívülrol támadó parazitákat, beleértve a vérszívó rovarokat is.

Összetételei:
RIZSCSÍRA-OLAJ: számos telítetlen zsírsavat és antioxidánst (E-vitamin, gamma-oryzanol) tartalmaz, amelyek ellensúlyozzák a szabad gyökök sejtkárosító hatását, és a bor mélyebb rétegeiben is biztosítják a regenerálódáshoz szükséges anyagokat.
HOMOKTÖVIS-OLAJ: elsosorban karotinoid és A-vitamin tartalmával tunik ki. UV sugárzás után regenerálja a bor mélyebb rétegeit, aktiválja a festéksejteket (melanociták), és napozás után javítja a bor pigmentációját.
JOJOBAOLAJ: növényi zsírokban gazdag, összetételével rendkívül közel áll a bor felszínén kialakuló, természetes faggyúréteghez. Védoréteget képez a test körül, és fokozza a bor védelmét.
LECITIN: foszfolipidek, elsosorban foszfatidil-kolinok gazdag forrása. Emulgátorként hat. Építoanyagot biztosít a sejtmembránok számára a bor regenerációja során.
ALMAECET: javítja a pH-t, fertotleníti a bor felszíni rétegeit, gyulladásgátló hatású, serkenti a bor megújhodását, segíti a Dermaton hatóanyagainak felszívódását.
GLICERIN: hidratálja és lágyítja a bort.
ETANOL: szabályozza a zsír felszívódását. A készítmény stabilizáló elemeként van jelen.
LEVENDULAOLAJ: illatosít, nyugtatja a bort, enyhíti a fájdalmat, jótékonyan hat a gyulladásokkal szemben, távol tartja a rovarokat.
BABÉR-, KAKUKKFU- és PÁLMARÓZSA-ILLÓOLAJ: kiegészítik a levendulaolaj hatásait.', 5, 4)
INSERT [dbo].[Items] ([itemid], [itemname], [description], [picture], [price], [itemquantity], [unit], [largedesc], [manufacturerid], [categoryid]) VALUES (27, N'Dermaton gél', N'A DERMATON kozmetikai termékcsalád tagjaként elsosorban napozás utáni borápolásra...', , 4900, 100, N'ml', N'A DERMATON kozmetikai termékcsalád tagjaként elsosorban napozás utáni borápolásra szolgál, de más célra is használhatjuk: husíti a bort, gyulladásellenes, nyugtató, valamint fiatalító hatású, emellett képes a zsírsejtek egyenletesen lebontására, amivel segítségünkre van a természetes vonalak megorzésében.
Olyan jótékony hatású, természetes összetevokbol készül, amelyek hidratálják, óvják, valamint regenerálják a bort. A napozás utáni borápolás mellett kiválóan alkalmazható a napsugárzás következtében vagy egyéb oknál fogva sérült, esetleg túlérzékeny bor kezelésére is. A gél könnyen felviheto és szétkenheto, ami foleg a túlzásba vitt napozás után fontos, hisz olyankor még a legenyhébb érintés is fájdalmas lehet.
Minden egyes cseppje beszívódik a borbe, és a készítmény egymás után többször is alkalmazható, így kellemesen és gyorsan husít, illetve nyugtat. Mindemellett lassítja a bor öregedését, és gátolja a ráncok kialakulását. Optimalizálja a zsírsejtek egyenletes lebomlását, valamint hatékonyan alkalmazható narancsbor ellen. Gyulladásgátló. Puhává varázsolja a bort, és biztosítja annak selymes tapintását, rugalmasságát. UV szurot nem tartalmaz, ezért naptejként nem használható. 
A gránátalma kivonat karotinoidokat tartalmaz, amelyek semlegesítik a szabad gyökök hatását a hámszövet felso rétegeiben. E hatás révén lassítja a bor öregedését.
A karitévajjal (shea vaj) és a barbadosi cseresznyével (acerola) biztosítja a bor számára nélkülözhetetlen vitaminokat (A, B, C, D, E, F), amelyek felgyorsítják a borsejtek anyagcseréjét, és segítenek egyenletesen lebontani a bor zsírszöveteit. Ennek köszönhetoen a készítmény hatékony a cellulitisszel szemben.
A telítetlen zsírsavakban gazdag jojobaolaj értékes faggyúréteget hoz létre, amely szerkezetében rendkívül hasonlatos a bor által termelt faggyúréteghez. A lanolin hatásai is hasonlók, de a lanolin a bor mélyebb rétegeiben muködve támogatja a fedosejtek egészséges megújulását.
Az Aloe vera kivonat hidratálja a bort, és irányítja annak regenerálódását. Emellett husíto és gyulladásellenes hatású.
A zöldtea-kivonat szintén gyulladáscsökkento hatású. A bor mélyebb rétegeiben serkenti a zsíranyagcserét, így megakadályozza a narancsbor kialakulását.
Az Echinacea (bíbor kasvirág) kivonata véd a kórokozóktól (vírusok és baktériumok), valamint normalizálja a bor immunreakcióit, így jótékonyan hat allergiás borreakciók esetén.
A pantenol egyrészt biztosítja a bor számára nélkülözhetetlen B5-vitamint, másrészt gyulladásellenes, regenerál és nyugtat.
Az E-vitamin (tokoferol) védi a bort az oxidációtól, és lassítja az öregedés folyamatát.', 2, 4)
