A bioinformációk olyan frekvenciák, amelyek rendkívül hasonlatosak a vegetatív idegrendszert, valamint a belso szervek muködését szabályozó, agykéreg alatti központok irányító impulzusaihoz. Muködésbe lépésük által zavar támad a negatív információk sorában, és elindul a visszaható regeneráló folyamat.

