A Betafit hatásai
A Betafit magas árványianyag- és vitamintartalmának köszönhetoen megnövekedett terhelés esetén, valamint mindennapi étrend-kiegészítoként is ajánlott. Bizonyítottan segíti az immunrendszer muködését, tisztítja a szervezetet, megadja a szükséges tápanyagokat, aminek következtében növeli a teljesítoképességet, a szervezet erejét, és összességében támogatja az egészséget.
Antioxidánsként segít megelozni az immunproblémákat, a rosszindulatú daganatok kialakulását, továbbá a vérképzési problémákat, és kiegészíto készítményként kiválóan használható a felsorolt betegségek kezelésében. A Betafit ösztönzi a káros anyagok kiválasztását, ezért hatékony készítmény vese-, húgyúti, máj-, esetleg epebetegségek kezelésében, emellett segítséget nyújt betegségmegelozo célú tisztítókúrákhoz, a végtagok elégtelen vérellátása, reumatikus panaszok és túlsúly esetében is. Jót tesz a bornek, a hajnak, a körmöknek, valamint kiválóan alkalmazható a legkülönbözobb kiütések és ekcémák esetén. A készítményben levo béta-karotin védi a bort az UV sugárzás káros hatásaitól.

Használata
méregtelenítés;
ásványi anyag, vitamin-, tápanyag-, enzim-, aminosav- és fehérjepótlás;
reumatikus panaszok;
vérellátási és vérképzési problémák;
oxidációs stressz, civilizációs betegségek és immunzavarok kialakulásának kockázata;
gyulladások, foleg húgyúti panaszok;
borkiütések, ekcéma;
rosszul táplált haj és körmök;
UV sugárzás;
gyengébb agymuködés, romló memória;
fogyókúra;
fáradtság, rossz kondíció, az életero hiánya.
Energetikai pályák
A Betafit elsosorban a máj, az epehólyag, a tüdo, a vastagbél és a vékonybél energetikai pályáját harmonizálja, vagyis éppen azokat a meridiánokat, amelyek közremuködnek a káros anyagok kiválasztásában. Rendkívül fontos a lép-hasnyálmirigy és a vese, továbbá a szív támogatása is.
', 5, 5)
